import data from '../../data/index.json';

export default function Experience() {
    return(
        <section className="experience--section"
        id="myExperience">
            <div className="experience--container">
                <h1 className="experience--section--heading">My Experience</h1>
            </div>
            <div className="experience--section--container">
                {data?.experiences?.map((item, index)=>(
                        <div key={index} className="experiences--section--card">
                            <div className="experiences--section--img">
                                <img src={item.src} alt="Company Logo" />
                            </div>
                            <div className="experiences--section--card--content">
                            <h2 className="experiences--section--title">{item.title}</h2>
                            <h3 className="experiences--section--company">{item.company}</h3>
                            <p className="experiences--section--description">{item.description}</p>
                            </div>
                        </div>
                ))}
            </div>
        </section>
    );
}
